import React from 'react';
import Card from './Card'


//Card List Component 


const CardList = ({ robots }) =>{
  return ( 
    <div>
      {
        robots.map((user,i) => {
          return ( 
             <Card 
              key={i}
              id={Robots[i].id} 
              name = {Robots[i].name} 
              email={Robots[i].email} 
              />
            )
         })
      }
    </div>
  );
}

export default CardList;
